    public class Test
    {
        [Fact]
        public static int TestEntryPoint()
        {
            if ((TestManyFields() == 100)
                && (TestManyFieldsPlusOne() == 100))
            {
                return 100;
            }
            return 1;
        }

        public static int TestManyFields()
        {
            try
            {
                TestLdManyFields();
            }
            catch (Exception)
            {
                Console.WriteLine("Failed TestManyFields");
                return 1;
            }
            return 100;
        }

        public static int TestManyFieldsPlusOne()
        {
            try
            {
                TestLdManyFieldsPlusOne();
            }
            catch (TargetInvocationException)
            {
                return 100;
            }
            catch (TypeLoadException)
            {
                return 100;
            }
            catch
            {
            }
            return 1;
        }

        [MethodImpl(MethodImplOptions.NoInlining)]
        internal static void TestLdManyFields()
        {
            object o = Activator.CreateInstance(typeof(ManyFields));
        }

        [MethodImpl(MethodImplOptions.NoInlining)]
        internal static void TestLdManyFieldsPlusOne()
        {
            object o = Activator.CreateInstance(typeof(ManyFieldsPlusOne));
        }
    }

